import React , {} from 'react';
import './App.css'
import Form from './components/Form'
import TodoList from './components/todoList'
function App() {
    return(
        <div className="App">
    <header>
    <h1>Abdullah's Todo List</h1>
    </header>
    <Form />
    <TodoList />
        </div>
    )
}

export default App;
